  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Clarence Rhode
  National Wildlife Range and Nunivak National Wildlife Refuge outlines Refuge accomplishments
  from September through December of 1963. The report begins by summarizing the weather
  conditions, habitat conditions, water conditions, and food and cover during this
  period. Wildlife- including migratory birds, upland game birds, furbearers, and
  raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments and collections and receipts. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors and safety. Items of interest and photographs are attached.\",\n\t\"license_title\":
